('145c9f30-6ccd-11e8-8fab-15a386398df4', 1, 0, 2, '加班', 'oodE244xb6DMsjK6o-0bLIfiCNYI', '', '加班，我讨厌加班，但是很多事情。那事情是急是没有办法打工的，你比如说我们做服务行业加班的几率就非常的多。发一到两杯，每当节假日的时候，你比如说国庆节。很多人都放假，那我们就选择留下来加班。佳能中我学到了很多东西，你比如说一个人的应变能力。你具体来讲在我们酒店到10月1号的时候国庆节有香港的客户有大。有家庭团体的客户，同时也有同事之间。过来留得那么针对这些人当中，你必须去观察他们的需求。他们提出来的，在同一个时间内提升的需求，你必须立马去解决，这就考验到你的。在加班当中，让我自己的职业生涯得到了很大的字很大的进步。都喽喽。得到了很多的提升，我选择了服务业，就必须为服务业。', 121, 0, 3, 1, NULL, '2018-06-10 16:41:12'),
