('484623d0-6be1-11e8-96a3-a9556e03594f', 1, 0, 2, '知足常乐', 'oodE24y7Yl7EEp3LQdSJEZTQI3NU', NULL, '知足常乐，而这个自主。如果说当你对现在的自己感到不满意的话，那么你的快乐肯定是打了折。都领略阿。非常的和谐，然后也没有那么的缺钱用，然后。也不会未来，就是说，生命的朋友也常在。撸撸不。主要是咧啊，不。有时候还是觉得却了点什么，所以说我就会去抱着我就会去。在工作中就会去唱发火，跟好朋友沟通的时候也常常不是那么的。谁也跟男朋友的时候沟通的时候，以后去吵架。当然没有说我对他们有什么样的敌意，有的时候还是出于对本身。', 135, 1, 3, 1, NULL, '2018-06-09 12:35:36'),
('48623750-6be1-11e8-8d19-53bab01be3fb', 1, 0, 2, '知足常乐', 'oodE24_KvBCV4H9d1f43avoaezRE', NULL, '每个人都要有知足常乐。那心里。我们生活在这个社会。总会遇到种种的不如意。包括我们的生活工作。学习。古人云。不满足则由十之八九。我们生活在这个。这些不满意的事情要占了。8090。但是我们也要常看。二这一二就是我们自己。我荣有的。像我现在的。二从大的方面。想可能有很多不如意的地方。包括工作，生活和学习。但是，想象文。有一个居住的地方。有一个听话的儿。适合一个比较出名。能干的爱人。二部。你生气而发愁，也不为。住宿而奔波。虽然工作不是太。都不是太高，但还算稳定。不会为一日。大耳发出也不会为。这东西没有钱而苦恼。我另外我也比较。学习爱上进，虽然说。没有达到自己想要求的目标。但是我。我也一直在弄你的向前。人生就是一个。不满足的过程，但。自我们在不满足中要看到。其中，有的东西做到知足。不长雒容有一种好的心态。我认为这些是幸福的。但我们要记住长咯。', 133, 1, 10, 2, NULL, '2018-06-09 12:35:36'),
