('51e1de80-6be5-11e8-8d19-53bab01be3fb', 1, 0, 2, '老师', 'oodE24_KvBCV4H9d1f43avoaezRE', '', '老师。我们人生中的导师。在我们上学。哥的时候第一次接触了老师。在小的时候老是在我。心中都是很神圣很神圣。老师说什么话我们都。等于是经理。老师对。没带人生产生。有很重要很重要的影响。特别是在小的时候。二我。那时候学习成绩比较。也受到老师的表扬。有时也会生出调皮的心理。这我清楚的记得。三年级时候的一件事情。老师当时说布置作业。说做错了多少多少。你要上天化站。当时可能故意气老师吧。然后爸爸会做的题都把。做错。试卷发下来以后吧。老师也没有借比我。别怪我！二他快。但是处了我。想象当时的我是多么的无。知其实这样做对老。这也是一种伤害。他明明知道这么。男的替我根本不会做错。但是。我这样做的。目的是在故意惹她生气。各位老师已经好多年。嫁了，但是他对我的宽容。对我的。我一直记在心里。老师的品德真。在值得我敬佩。我们每个人的一生都会遇到了。四好的老师会影响我们的。女生。愿我们每个人都做。好的老师。', 137, 0, 4, 1, NULL, '2018-06-09 13:02:12'),
