('8fd6dd50-6d73-11e8-867e-29bd87a67c01', 1, 0, 2, '此刻最想吐槽的一件事', 'oodE24_KvBCV4H9d1f43avoaezRE', '', '此刻我。不想吐槽的一件事，也是我的心。请我现在在。我很累，很累。早晨我五点钟就起来。钱来了重重。大牙洗脸，然后送小孩去。学校回来已经七点。多了七点多以后。我又送爱人出。然后就匆匆上班了。通过这件事我感觉。生活真的不易。有些事。挺是我们不得不做的，有些事。是我们。又必须面对的，比如。我比如照顾家庭。怎么才能把工作中的事情。安排合理高效，又让。即精力充沛呢这是。是我现在最想。思考的问题。有时我想象这约。虽然没有什么话不像。我们现在人生活很累很累。是不是我背负的太多。多呢。应该生命是有限的。在有限的生命里，我们是烤肉。什么是最重要的事吗。应该放下的。这是一个。很大的这些问题。要不然我们每个人都生活得。累很累。三点刺激的生命。那你对自己的每一天。解金生中不留。把遗憾。二这是。我悟到的真理。愿你和我一样。到事情不要后悔。好好思考自己的人生。', 132, 0, 3, 0, NULL, '2018-06-11 12:32:58'),
