('a6906a00-6d7a-11e8-867e-29bd87a67c01', 1, 0, 2, '关系', 'oodE24_KvBCV4H9d1f43avoaezRE', '', '金或者这。那社会都出现关系之中。我没和爱人孩子的。我们和老板同事的关系。怎么和客户的关系甚至。不过我们出来买东西除外吧。四和顾客。和一些和我们。提供合作者的关系。在生活中我们。处理好关系，非常非常的重要。首先是家庭关系我。没有处理好和父母的关系。那关系和兄弟。别关系和子女的。在工作中，我们更要处理。和客户的关系和老板的。那些和领导的关系，和同事的。你现在和下属的关系。这关系中处理不好。栗子引起坏的结果比比。爵士舞。在历史上成功来人物。就因为他处理好了关系。以前是。也清宫。让我想起了汉朝的开国皇帝。我帮他比较下雨出。你关系这一帮人之。他有问清无价也。出谋划策的模式。大家都知道鸿门宴吧。就因为是张良。二和向波的。关系像波霸项羽。你要打。六八的消息告诉了张林。张良又告诉了刘邦。让刘邦。在鸿门宴中惊险脱身。假如没有项伯和张力。没关系。都邦也许就被下雨打败。说了这么。我是想让大家知道关系。在重要性在我们的生活中处理。关系我们的人生也就成功了。', 133, 0, 2, 0, NULL, '2018-06-11 13:23:42'),
