('cb255180-6d72-11e8-867e-29bd87a67c01', 1, 0, 2, '高铁', 'oodE24_KvBCV4H9d1f43avoaezRE', '', '高铁试试。一事，现在科技。中国高铁。我在新闻上。很早很早就听说了，但。我今天坐高铁还是。2012。四年吧。2014年我。长沙回东莞那是我弟。坐高铁。大师我今天感觉到。你叫你一日饭的感觉。高铁比普通。列车快。多每小时能达到300。物理。高铁没有卧铺。大家只能坐着。我想。是一种效率的体现吧。在高铁上大家都是行色匆匆。没有在一班列车。买那种坏烫坏沃。该做的书是这样。昨天上大家要吗。闭目养神，要么拿到。该工作。要么。吃点休闲的。名师。做高铁介绍了事件。但我认为。别说了一些做普通。二贴吧！普通客车的落去吧。谁知道。中国的多远发。你们的出行方式也越来越。多样性高铁适合于。比较短距离的旅行加入。所以超过四小时以上，我认为高低。就好不是那么好了。', 129, 1, 4, 1, NULL, '2018-06-11 12:27:26'),
