('dc82e150-6d7b-11e8-ae43-517e9b4b0f94', 1, 0, 2, '如何过一天', 'oodE240wf_ABPfldbaNzkrUBBc14', '', '有的时候确实会在没有去信。到单位时间内甚至是。具体到一天，我如何。你度过似乎好像做。计划总是会想的特别大。我未来一年未来。赶紧未来五年要做什么是。呼呼呼呼，这个事情是一个。特别重要的一个。规划不走，但是。却没有具体想到。不把这些事情拆解到具体美。明天具体在一个时间段。去合理的去度过它。然后这一天对你来说。是平平凡凡的一天。谁让你觉得特别有劲一点的一。点又该怎么去度过。之前其实。阿有段时间上班觉得好像我美。你上班下班，好像日子过的。特别快，但是等我一个月后。就回复我上个月做的事情处理。这些记忆深刻的。我动之外，其他的其实都是。百度甚至忘了自己有的。吃过了哪些特别好吃的东西。做过了哪些觉得让我。大家开心的事情，或者我。哪个时间段特别不开心。你觉得我们人生其实就一些特别重。这时间点让我觉得印象深刻。所以，有的时候我觉得。自己基本都可以。忘记大部分自己的时间是怎么读。所以呢，我有一个。小的一个啊。计划希望未来自己能够。去做一个记录，甚至是能。我爱突出自己做一个。预计这样当我再回。我的时候，即便那天是非常频繁的。但明天也留下过我自己的一个。g人生可能就那么。1万天每一天怎么过。开心还是不开心，那我。早在自己在冀中。能够找到一些啊。那自己觉得特别棒的是肯定。谢谢。', 134, 1, 3, 1, NULL, '2018-06-11 13:32:21'),
