('f095e890-6be1-11e8-8d19-53bab01be3fb', 2, 0, 2, '知足常乐', 'oodE24_KvBCV4H9d1f43avoaezRE', '', '每个人都要有知足常乐。那心里。我们生活在这个社会。总会遇到种种的不如意。包括我们的生活工作。学习。古人云。不满足则由十之八九。我们生活在这个。这些不满意的事情要占了。8090。但是我们也要常看。二这一二就是我们自己。我荣有的。像我现在的。二从大的方面。想可能有很多不如意的地方。包括工作，生活和学习。但是，想象文。有一个居住的地方。有一个听话的儿。适合一个比较出名。能干的爱人。二部。你生气而发愁，也不为。住宿而奔波。虽然工作不是太。都不是太高，但还算稳定。不会为一日。大耳发出也不会为。这东西没有钱而苦恼。我另外我也比较。学习爱上进，虽然说。没有达到自己想要求的目标。但是我。我也一直在弄你的向前。人生就是一个。不满足的过程，但。自我们在不满足中要看到。其中，有的东西做到知足。不长雒容有一种好的心态。我认为这些是幸福的。但我们要记住长咯。是不。在研究我感觉你做的。好的方面比较切合。那实际。然后从自己的方方面面拘留。自己的。自助餐咯。比较扣题开始。别是吧，这个自助餐咯。阐述的比较好。总体来说是一瓶。不错的研究，我。今天我讲了我自己的眼睛感觉。把好多不如意的地方对比。和你对比感觉的你。都有几点启发吧一个。猪蹄猪蹄挖掘。在我具体挖掘的不好。栗子也不好局。你感觉的笔记，觉得比较器。和实际最后也将了应该。', 63, 0, 2, 0, '484623d0-6be1-11e8-96a3-a9556e03594f', '2018-06-09 12:39:06'),
